import React, { useState } from "react";
import "./App.css";
import Header from "../Header/header";
import Modal from "../Modal/modal";

function App() {
  const [modal, setModal] = useState<boolean>(false);
  return (
    <div className='App'>
      <Header />
      <Modal {...setModal} />
    </div>
  );
}

export default App;
